    <P STYLE="font: 11pt Arial, Helvetica, Sans-Serif; margin: 0pt 0; color: rgb(41,109,193)"><FONT STYLE="text-transform: uppercase">Structured
    Investments</FONT></P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0; color: #296DC1"></P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0; color: rgb(41,109,193)">Opportunities in U.S. and International Equities</P>
    
    <P STYLE="font: 8pt Arial, Helvetica, Sans-Serif; margin: 0pt 0; color: #296DC1"></P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0; color: #296DC1">Contingent Income Callable Securities due August
    22, 2019</P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0; color: #296DC1"></P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0; color: gray"><B>Based on the Value of the Worst Performing of
    the Russell 2000<SUP>&reg;</SUP> Index, the S&amp;P 500<SUP>&reg;</SUP> Index and the EURO STOXX 50<SUP>&reg;</SUP> Index</B></P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0; color: gray"></P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0; text-align: justify; color: gray"><FONT STYLE="font-size: 9pt"><B>Principal
    at Risk Securities</B></FONT></P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0; text-align: justify; color: gray"></P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0"><FONT STYLE="background-color: white">Unlike conventional debt
    securities, the securities do not guarantee the payment of interest or any repayment of principal at maturity. Instead, the securities
    offer the opportunity for investors to receive a contingent quarterly payment equal to at least </FONT>2.05% <FONT STYLE="background-color: white">of
    the stated principal amount (the actual contingent quarterly payment will be determined on the pricing date) with respect to each
    quarterly determination period if a coupon barrier event has not occurred during that determination period. However, if a coupon
    barrier event has occurred during a determination period, investors will not receive any contingent quarterly payment for that
    determination period. A coupon barrier event will occur with respect to a determination period if the closing level of </FONT><B>any</B>
    underlier <FONT STYLE="background-color: white">is less than </FONT>70% <FONT STYLE="background-color: white">of its initial underlier
    value, which we refer to as a </FONT>downside threshold level<FONT STYLE="background-color: white">, on <B>any</B> scheduled trading
    day during that determination period. In addition, on any contingent payment date</FONT> (other than the final contingent payment
    date)<FONT STYLE="background-color: white">, <B>we will have the right to redeem the securities at our discretion</B> for an amount
    per security equal to the stated principal amount <I>plus</I> any contingent quarterly payment otherwise due. Any early redemption
    of the securities will be at our discretion and will not automatically occur based on the performance of the underliers. If the
    securities are not redeemed prior to maturity and the final underlier value of <B>each</B> underlier is greater than or equal to
    </FONT>its <FONT STYLE="background-color: white">downside threshold level, the payment at maturity due on the securities will be
    equal to the stated principal amount <I>plus</I> any contingent quarterly payment otherwise due. However, if the securities are
    not redeemed prior to maturity and the final underlier value of </FONT><B>any</B> underlier <FONT STYLE="background-color: white">is
    less than its downside threshold level, at maturity investors will lose 1% of the stated principal amount for every 1% that the
    final underlier value of the </FONT>worst p<FONT STYLE="background-color: white">erforming underlier is less than its initial underlier
    value. Under these circumstances, the amount investors receive will be less than </FONT>70% <FONT STYLE="background-color: white">of
    the stated principal amount and could be zero. Because all payments on the securities are based on the </FONT>worst p<FONT STYLE="background-color: white">erforming
    of the underliers, a decline in the closing level of </FONT><B>any</B> underlier <FONT STYLE="background-color: white">below its
    </FONT>downside threshold level <FONT STYLE="background-color: white">on any scheduled trading day during most or all of the determination
    periods will result in few or no contingent quarterly payments, and a decline in the closing level of </FONT><B>any</B> underlier
    <FONT STYLE="background-color: white">below its downside threshold level on the final determination date will result in a significant
    loss of your investment, </FONT>in each case, even if the other underliers appreciate or have not declined as much<FONT STYLE="background-color: white">.
    The securities are for investors who are willing and able to risk their principal and forgo guaranteed interest payments, in exchange
    for the opportunity to receive contingent quarterly payments at a potentially above-market rate, subject to early redemption at
    our discretion. Investors will not participate in any appreciation of </FONT><B>any</B> underlier <FONT STYLE="background-color: white">even
    though investors will be exposed to the depreciation in the value of the </FONT>worst p<FONT STYLE="background-color: white">erforming
    underlier if the securities have not been redeemed prior to maturity and the final underlier value of the </FONT>worst p<FONT STYLE="background-color: white">erforming
    underlier is less than its downside threshold level. <B>Investors may lose their entire initial investment in the securities. The
    securities are unsecured and unsubordinated debt obligations of Barclays Bank PLC. Any payment on the securities, including any
    repayment of principal, is subject to the creditworthiness of Barclays Bank PLC and is not guaranteed by any third party. If Barclays
    Bank PLC were to default on its payment obligations or become subject to the exercise of any U.K. Bail-in Power (as described on
    page 5 of this document) by the relevant U.K. resolution authority, you might not receive any amounts owed to you under the securities.
    See &ldquo;Risk Factors&rdquo; and &ldquo;Consent to U.K. Bail-in Power&rdquo; in this document and &ldquo;Risk Factors&rdquo;
    in the accompanying prospectus supplement.</B></FONT></P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0"></P>
    
