        <TD STYLE="text-align: left; layout-grid-mode: char; color: #296DC1; font-weight: bold"><FONT STYLE="font-size: 10pt">Reference assets*:</FONT></TD>
        <TD COLSPAN="5" STYLE="layout-grid-mode: char"><FONT STYLE="font-size: 10pt">Russell 2000<SUP>&reg;</SUP> Index (Bloomberg ticker symbol &ldquo;RTY&lt;Index&gt;&rdquo;) (the &ldquo;RTY Index&rdquo;), S&amp;P 500<SUP>&reg;</SUP> Index (Bloomberg ticker symbol &ldquo;SPX&lt;Index&gt;&rdquo;) (the &ldquo;SPX Index&rdquo;) and EURO STOXX 50<SUP>&reg;</SUP> Index (Bloomberg ticker symbol &ldquo;SX5E&lt;Index&gt;&rdquo;) (the &ldquo;SX5E Index&rdquo;) (each an &ldquo;underlier&rdquo; and together the &ldquo;underliers&rdquo;)</FONT></TD></TR>
    <TR STYLE="vertical-align: top; background-color: #DCEBF4">
        <TD NOWRAP STYLE="text-align: left; layout-grid-mode: char; color: #296DC1; font-weight: bold"><FONT STYLE="font-size: 10pt">Aggregate principal amount:</FONT></TD>
        <TD COLSPAN="5" STYLE="layout-grid-mode: char"><FONT STYLE="font-size: 10pt">$</FONT></TD></TR>
    <TR STYLE="vertical-align: top">
        <TD STYLE="text-align: left; layout-grid-mode: char; color: #296DC1; font-weight: bold"><FONT STYLE="font-size: 10pt">Stated principal amount:</FONT></TD>
        <TD COLSPAN="5" STYLE="layout-grid-mode: char"><FONT STYLE="font-size: 10pt">$1,000 per security</FONT></TD></TR>
    <TR STYLE="vertical-align: top; background-color: #DCEBF4">
        <TD STYLE="text-align: left; layout-grid-mode: char; color: #296DC1; font-weight: bold"><FONT STYLE="font-size: 10pt">Initial issue price:</FONT></TD>
        <TD COLSPAN="5" STYLE="layout-grid-mode: char"><FONT STYLE="font-size: 10pt">$1,000 per security (see &ldquo;Commissions and initial issue price&rdquo; below)</FONT></TD></TR>
    <TR STYLE="vertical-align: top">
        <TD STYLE="font-size: 11pt"><FONT STYLE="font-family: Arial, Helvetica, Sans-Serif; font-size: 10pt; color: #296DC1"><B>Pricing date<SUP>&dagger;</SUP>:</B></FONT></TD>
        <TD COLSPAN="5" STYLE="layout-grid-mode: char"><FONT STYLE="font-size: 10pt">August 18, 2017</FONT></TD></TR>
    <TR STYLE="vertical-align: top; background-color: #DCEBF4">
        <TD STYLE="font-size: 11pt"><FONT STYLE="font-family: Arial, Helvetica, Sans-Serif; font-size: 10pt; color: #296DC1"><B>Original issue date<SUP>&dagger;</SUP>:</B></FONT></TD>
        <TD COLSPAN="5" STYLE="layout-grid-mode: char"><FONT STYLE="font-size: 10pt">August 23, 2017</FONT></TD></TR>
    <TR STYLE="vertical-align: top">
        <TD STYLE="text-align: left; layout-grid-mode: char; color: #296DC1; font-weight: bold"><FONT STYLE="font-size: 10pt">Maturity date<SUP>&dagger;</SUP>:</FONT></TD>
        <TD COLSPAN="5" STYLE="layout-grid-mode: char"><FONT STYLE="font-size: 10pt">August 22, 2019</FONT></TD></TR>
    <TR STYLE="vertical-align: top; background-color: #DCEBF4">
        <TD NOWRAP STYLE="text-align: left; layout-grid-mode: char; color: #296DC1; font-weight: bold"><FONT STYLE="font-size: 10pt">Optional early redemption:</FONT></TD>
        <TD COLSPAN="5" STYLE="layout-grid-mode: char"><FONT STYLE="font-size: 10pt">On any contingent payment date (other than the final contingent payment date), we will have the right to redeem the securities, in whole, but not in part, at our discretion, for the early redemption payment. If we decide to redeem the securities on a contingent payment date, we will give you notice on or before the immediately preceding determination period-end date. Any early redemption of the securities will be at our discretion and will not automatically occur based on the performance of the underliers. <B>No further payments will be made on the securities after they have been redeemed.</B></FONT></TD></TR>
    <TR STYLE="vertical-align: top">
        <TD STYLE="text-align: left; layout-grid-mode: char; color: #296DC1; font-weight: bold"><FONT STYLE="font-size: 10pt">Early redemption payment:</FONT></TD>
        <TD COLSPAN="5" STYLE="layout-grid-mode: char"><FONT STYLE="font-size: 10pt">The early redemption payment will be an amount per security equal to (i) the stated principal amount <I>plus</I> (ii) any contingent quarterly payment otherwise due.</FONT></TD></TR>
    <TR STYLE="vertical-align: top; background-color: #DCEBF4">
        <TD STYLE="text-align: left; layout-grid-mode: char; color: #296DC1; font-weight: bold"><FONT STYLE="font-size: 10pt">Contingent quarterly payment:</FONT></TD>
        <TD COLSPAN="5">
            <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0 0pt 8.1pt; text-indent: -9pt"><FONT STYLE="font-family: Symbol">&middot;&#9;</FONT><FONT STYLE="font-family: Arial, Helvetica, Sans-Serif">&nbsp;If
            a coupon barrier event has not occurred during a determination period, we will pay a contingent quarterly payment of at least $20.50
            (at least 2.05% of the stated principal amount) per security on the related contingent payment date with respect to that determination
            period. The actual contingent quarterly payment will be determined on the pricing date.</FONT></P>
            <P STYLE="font: 2pt Arial, Helvetica, Sans-Serif; margin: 0pt 0 0pt 8.1pt; text-indent: -9pt">&nbsp;</P>
            <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0 0pt 8.1pt; text-indent: -9pt"><FONT STYLE="font-family: Symbol">&middot;&#9;</FONT><FONT STYLE="font-family: Arial, Helvetica, Sans-Serif">&nbsp;If
    a coupon barrier event has occurred during a determination period, no contingent quarterly payment will be made with respect to
    that determination period.</FONT></P></TD></TR>
    <TR STYLE="vertical-align: top">
        <TD STYLE="text-align: left; layout-grid-mode: char; color: #296DC1; font-weight: bold"><FONT STYLE="font-size: 10pt">Payment at maturity:</FONT></TD>
        <TD COLSPAN="5">
            <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">If the securities are not redeemed prior to maturity, you will
            receive on the maturity date a cash payment per security determined as follows:</P>
            <P STYLE="font: 2pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">&nbsp;</P>
            <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0 0pt 8.1pt; text-indent: -9pt"><FONT STYLE="font-family: Symbol">&middot;&#9;</FONT><FONT STYLE="font-family: Arial, Helvetica, Sans-Serif">If
            the final underlier value of each underlier is <B>greater than or equal to</B> its downside threshold level:</FONT></P>
            <P STYLE="font: 2pt Arial, Helvetica, Sans-Serif; margin: 0pt 0 0pt 8.1pt; text-indent: -9pt">&nbsp;</P>
            <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0 0pt 0.3in; text-indent: 0in">(i) stated principal amount <I>plus</I>
            (ii) any contingent quarterly payment otherwise due</P>
            <P STYLE="font: 2pt Arial, Helvetica, Sans-Serif; margin: 0pt 0 0pt 0.3in; text-indent: 0in">&nbsp;</P>
            <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0 0pt 8.1pt; text-indent: -9pt"><FONT STYLE="font-family: Symbol">&middot;&#9;</FONT><FONT STYLE="font-family: Arial, Helvetica, Sans-Serif">If
            the final underlier value of <B>any</B> underlier is <B>less than</B> its downside threshold level:</FONT></P>
            <P STYLE="font: 2pt Arial, Helvetica, Sans-Serif; margin: 0pt 0 0pt 8.1pt; text-indent: -9pt">&nbsp;</P>
            <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0 0pt 0.3in; text-indent: 0in">stated principal amount &times; underlier
            performance factor of the worst performing underlier</P>
            <P STYLE="font: 2pt Arial, Helvetica, Sans-Serif; margin: 0pt 0 0pt 0.3in; text-indent: 0in">&nbsp;</P>
            <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0"><B><I>Under these circumstances, the payment at maturity
    will be less than the stated principal amount of $1,000 and will represent a loss of more than 30%, and possibly all, of an investor&rsquo;s
    initial investment. Investors may lose their entire initial investment in the securities. Any payment on the securities, including
    any repayment of principal, is not guaranteed by any third party and is subject to (a) the creditworthiness of Barclays Bank PLC
    and (b) the risk of exercise of any U.K. Bail-in Power by the relevant U.K. resolution authority.</I></B></P></TD></TR>
    <TR STYLE="vertical-align: top; background-color: #DCEBF4">
        <TD STYLE="text-align: left; layout-grid-mode: char; color: #296DC1; font-weight: bold"><FONT STYLE="font-size: 10pt">U.K. Bail-in Power acknowledgment:</FONT></TD>
        <TD COLSPAN="5" STYLE="font-size: 11pt"><FONT STYLE="font-family: Arial, Helvetica, Sans-Serif; font-size: 10pt">Notwithstanding any other agreements, arrangements or understandings between Barclays Bank PLC and any holder of the securities, by acquiring the securities, each holder of the securities acknowledges, accepts, agrees to be bound by and consents to the exercise of, any U.K. Bail-in Power by the relevant U.K. resolution authority. See &ldquo;Consent to U.K. Bail-in Power&rdquo; on page 5 of this document.</FONT></TD></TR>
    <TR STYLE="vertical-align: top; background-color: white">
