        <!-- Field: /Page -->
    
    <P STYLE="font: 12pt Arial, Helvetica, Sans-Serif; margin: 0pt 0"><FONT STYLE="font-size: 10pt; background-color: white"><B>&nbsp;</B></FONT></P>
    
    <P STYLE="font: 12pt Arial, Helvetica, Sans-Serif; margin: 0pt 0"><FONT STYLE="font-size: 10pt; background-color: white"><B></B></FONT><BR CLEAR="ALL">
    <FONT STYLE="font-size: 14pt; color: #296DC1">Investment Summary</FONT></P>
    
    <P STYLE="font: 6pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">&nbsp;</P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0; color: #296DC1"><B>Contingent Income Callable Securities</B></P>
    
    <P STYLE="font: 4pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">&nbsp;</P>
    
    <P STYLE="font: 9pt Arial, Helvetica, Sans-Serif; margin: 0pt 0; color: Gray"><B>Principal at Risk Securities</B></P>
    
    <P STYLE="font: 8pt Arial, Helvetica, Sans-Serif; margin: 0pt 0; color: gray">&nbsp;</P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">The Contingent Income Callable Securities due August 22, 2019
    Based on the Value of the Worst Performing of the Russell 2000<SUP>&reg;</SUP> Index, the S&amp;P 500<SUP>&reg;</SUP> Index and
    the EURO STOXX 50<SUP>&reg;</SUP> Index, which we refer to as the securities, provide an opportunity for investors to receive a
    contingent quarterly payment, which is an amount equal to at least $20.50 (at least 2.05% of the stated principal amount), with
    respect to each quarterly determination period if a coupon barrier event has not occurred during that determination period. However,
    if a coupon barrier event has occurred during a determination period, investors will not receive any contingent quarterly payment
    for that determination period. A coupon barrier event will occur with respect to a determination period if the closing level of
    <B>any</B> underlier is less than 70% of its initial underlier value, which we refer to as a downside threshold level, on <B>any</B>
    scheduled trading day during that determination period. The actual contingent quarterly payment will be determined on the pricing
    date. The closing level of at least one of the underliers could be below its downside threshold level on any scheduled trading
    day during most or all of the determination periods so that you receive few or no contingent quarterly payments over the term of
    the securities.</P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">&nbsp;</P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">On any contingent payment date (other than the final contingent
    payment date), <B>we will have the right to redeem the securities at our discretion</B> for an early redemption payment equal to
    the stated principal amount <I>plus</I> any contingent quarterly payment otherwise due. If the securities are redeemed prior to
    maturity, investors will receive no further contingent quarterly payments. Any early redemption of the securities will be at our
    discretion and will not automatically occur based on the performance of the underliers. At maturity, if the securities have not
    previously been redeemed and the final underlier value of each underlier is greater than or equal to its downside threshold level,
    the payment at maturity will be equal to the stated principal amount <I>plus</I> any contingent quarterly payment otherwise due.
    However, if the securities have not previously been redeemed and the final underlier value of any underlier is less than its downside
    threshold level, investors will lose 1% of the stated principal amount for every 1% that the final underlier value of the worst
    performing underlier is less than its initial underlier value. Under these circumstances, the amount investors receive will be
    less than 70% of the stated principal amount and could be zero. Investors in the securities must be willing and able to accept
    the risk of losing their entire initial investment based on the performance of the worst performing underlier and also the risk
    of not receiving any contingent quarterly payment throughout the entire term of the securities. In addition, investors will not
    participate in any appreciation of any underlier.</P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">&nbsp;</P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0"></P>
    
    <!-- Field: Page; Sequence: 6; Value: 2 -->
        <DIV STYLE="margin-bottom: 6pt; border-bottom: Black 1pt solid"><P STYLE="margin: 0pt"></P><TABLE CELLSPACING="0" CELLPADDING="0" STYLE="font: 10pt Arial, Helvetica, Sans-Serif; width: 100%; border-collapse: collapse"><TR STYLE="vertical-align: top"><TD STYLE="width: 52%; font-size: 8pt; color: #296DC1"><FONT STYLE="font-size: 10pt">August 2017</FONT></TD><TD STYLE="width: 48%; text-align: right; font-size: 8pt; color: #296DC1"><FONT STYLE="font-size: 10pt">Page <!-- Field: Sequence; Type: Arabic; Name: PageNo -->6<!-- Field: /Sequence --></FONT></TD></TR></TABLE><P STYLE="margin: 0pt"></P></DIV>
        <DIV STYLE="page-break-before: always; margin-top: 6pt"><P STYLE="font: 12pt Arial, Helvetica, Sans-Serif; margin: 0pt 5pt 0pt 0; text-align: right"><IMG SRC="image_007.jpg" ALT="" STYLE="height: 33px; width: 144px"></P><P STYLE="font: 4pt Arial, Helvetica, Sans-Serif; margin: 0pt 4pt 0pt 0; text-align: right">&nbsp;</P><P STYLE="font: 11pt Arial, Helvetica, Sans-Serif; margin: 0pt; color: rgb(41,109,193); border-top: rgb(41,109,193) 1pt solid; padding-top: 4pt">Contingent Income Callable Securities due August 22, 2019</P><P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0; color: Gray"><B>Based on the Value of the Worst Performing of the Russell 2000<SUP>&reg;</SUP> Index, the S&amp;P 500<SUP>&reg;</SUP> Index and the EURO STOXX 50<SUP>&reg;</SUP> Index</B></P><P STYLE="font: 9pt Arial, Helvetica, Sans-Serif; margin: 0pt; color: Gray; border-bottom: rgb(41,109,193) 1pt solid; padding-bottom: 4pt"><B>Principal at Risk Securities</B></P>&nbsp;</DIV>
        <!-- Field: /Page -->
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">&nbsp;</P>
    
    <P STYLE="font: 14pt Arial, Helvetica, Sans-Serif; margin: 0pt 0; color: #296DC1">Key Investment Rationale</P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">&nbsp;</P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">The securities offer investors an opportunity to receive a contingent
    quarterly payment of at least $20.50 (at least 2.05% of the stated principal amount) with respect to each determination period
    if a coupon barrier event has not occurred during that determination period. The actual contingent quarterly payment will be determined
    on the pricing date. On any contingent payment date (other than the final contingent payment date), we will have the right to redeem
    the securities at our discretion for the stated principal amount per security <I>plus</I> any contingent quarterly payment otherwise
    due. Any early redemption of the securities will be at our discretion and will not automatically occur based on the performance
    of the underliers. The following scenarios reflect the potential payments, if any, on the securities:</P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">&nbsp;</P>
    
    <TABLE CELLSPACING="0" CELLPADDING="3" STYLE="font: 10pt Arial, Helvetica, Sans-Serif; width: 100%; border-collapse: collapse">
    <TR STYLE="vertical-align: top">
        <TD STYLE="width: 15%; border-right: white 3pt solid; border-bottom: white 3pt solid; border-left: white 3pt solid; background-color: #DCEBF4; font-size: 11pt"><FONT STYLE="font-family: Arial, Helvetica, Sans-Serif; font-size: 10pt; color: #296DC1"><B>Scenario 1</B></FONT></TD>
        <TD STYLE="width: 85%">
            <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0; color: #296DC1"><B>On any contingent payment date (other than
            the final contingent payment date), we redeem the securities.</B></P>
            <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0; color: #296DC1">&nbsp;</P>
            <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0 0pt 0.5in; text-indent: -0.25in"><FONT STYLE="font-family: Wingdings; color: #DCEBF4">&sect;&#9;</FONT><FONT STYLE="font-family: Arial, Helvetica, Sans-Serif">&nbsp;The
            securities will be redeemed for (i) the stated principal amount <I>plus</I> (ii) any contingent quarterly payment otherwise due.</FONT></P>
            <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0 0pt 0.5in; text-indent: -0.25in">&nbsp;</P>
            <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0 0pt 0.5in; text-indent: -0.25in"><FONT STYLE="font-family: Wingdings; color: #DCEBF4">&sect;&#9;</FONT><FONT STYLE="font-family: Arial, Helvetica, Sans-Serif">&nbsp;Investors
            will not participate in any appreciation of any underlier from its initial underlier value and will receive no further contingent
            quarterly payments.</FONT></P>
            <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0 0pt 0.5in; text-indent: -0.25in">&nbsp;</P>
            <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">Any early redemption of the securities will be at our discretion
            and will not automatically occur based on the performance of the underliers. It is more likely that we will redeem the securities
            when it would otherwise be advantageous for you to continue to hold the securities. As such, we will be more likely to redeem the
            securities when the closing level of each underlier appears likely to be at or above its downside threshold level, which might
            otherwise result in an amount of interest payable on the securities that is greater than instruments of a comparable maturity and
            credit rating trading in the market. In other words, we will be more likely to redeem the securities when the securities are paying
            an above-market coupon. If the securities are redeemed prior to maturity, you will receive no more contingent quarterly payments
            and may be forced to reinvest in a lower interest rate environment. There is no guarantee that you would be able to reinvest the
            proceeds from an investment in the securities in a comparable investment with a similar level of risk in the event the securities
            are redeemed prior to the maturity date. On the other hand, we will be less likely to exercise our redemption right when the closing
            level of any underlier appears likely to be below its downside threshold level, such that you might receive no further contingent
            quarterly payments and that you might suffer a significant loss on your investment in the securities at maturity. Therefore, if
            we do not exercise our redemption right, it is more likely that you will receive few or no contingent quarterly payments and that
            you will suffer a significant loss on your investment at maturity.</P>
            <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">&nbsp;</P></TD></TR>
    <TR STYLE="vertical-align: top">
        <TD STYLE="border-right: white 3pt solid; border-bottom: white 3pt solid; border-left: white 3pt solid; background-color: #DCEBF4; font-size: 11pt"><FONT STYLE="font-family: Arial, Helvetica, Sans-Serif; font-size: 10pt; color: #296DC1"><B>Scenario 2</B></FONT></TD>
        <TD>
            <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0; color: #296DC1"><B>The securities are not redeemed prior to maturity
            and the final underlier value of each underlier is <I>greater than or equal to </I>its downside threshold level.</B></P>
            <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0; color: #296DC1">&nbsp;</P>
