    <P STYLE="font: 14pt Arial, Helvetica, Sans-Serif; margin: 0pt 0; color: #296DC1">Hypothetical Examples</P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">&nbsp;</P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">The numbers appearing in the following examples may have been
    rounded for ease of analysis. The examples below assume that the securities will be held until maturity or earlier redemption and
    do not take into account the tax consequences of an investment in the securities. The examples below are based on the following
    terms:*</P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">&nbsp;</P>
    
    <TABLE CELLSPACING="0" CELLPADDING="2" STYLE="font: 10pt Arial, Helvetica, Sans-Serif; width: 100%; border-collapse: collapse">
