        <TD STYLE="font-size: 11pt"><FONT STYLE="font-family: Arial, Helvetica, Sans-Serif; font-size: 10pt">With respect to each underlier: 70.000, which is 70% of its hypothetical initial underlier value</FONT></TD></TR>
    <TR STYLE="vertical-align: top; background-color: #DCEBF4">
        <TD STYLE="font-size: 10pt; text-align: left; layout-grid-mode: char; color: #296DC1; font-weight: bold"><FONT STYLE="font-size: 10pt">Hypothetical Contingent Quarterly Payment:</FONT></TD>
        <TD STYLE="font-size: 11pt"><FONT STYLE="font-family: Arial, Helvetica, Sans-Serif; font-size: 10pt">$20.50 (2.05% of the stated principal amount). The actual contingent quarterly payment will be set on the pricing date and will be at least 2.05% of the stated principal amount.</FONT></TD></TR>
    <TR STYLE="vertical-align: top">
        <TD STYLE="font-size: 10pt; text-align: left; layout-grid-mode: char; color: #296DC1; font-weight: bold"><FONT STYLE="font-size: 10pt">Stated Principal Amount:</FONT></TD>
