    <P STYLE="font: 8pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">&nbsp;</P>
    
    <P STYLE="font: 8pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">* If we redeem the securities, the early redemption payment will
    include any contingent quarterly payment otherwise due.</P>
    
    <P STYLE="font: 8pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">&nbsp;</P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">In Example 1, we redeem the securities on the contingent payment
    date following the first determination period. As a coupon barrier event did not occur during the related determination period,
    the early redemption payment you receive following the first determination period will include the contingent quarterly payment
    due with respect to that determination period, and the early redemption payment will be calculated as follows:</P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">&nbsp;</P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0; text-align: center"><FONT STYLE="background-color: white">stated
    principal amount + contingent quarterly payment = $1,000 + </FONT>$20.50 <FONT STYLE="background-color: white">= </FONT>$1,020.50</P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0; text-align: center">&nbsp;</P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0"><I>In this example, the optional early redemption feature limits
    the term of your investment to approximately 3 months, and you may not be able to reinvest at comparable terms or returns. If the
    securities are redeemed early, you will stop receiving contingent quarterly payments. Further, although the worst performing underlier
    has appreciated from its initial underlier value as of the first determination period-end date, upon early redemption you receive
    only $1,020.50 per security and do not benefit from the appreciation of any underlier.</I></P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">&nbsp;</P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">In Example 2, we redeem the securities on the contingent payment
    date following the sixth determination period. As a coupon barrier event has not occurred during the first and fifth determination
    periods, you receive the contingent quarterly payment of $20.50 with respect to those determination periods. Because a coupon barrier
    event has occurred with respect to the sixth determination period, the early redemption payment you receive following the sixth
    determination period will not include any contingent quarterly payment with respect to that determination period, and the early
    redemption payment will be equal to the stated principal amount of $1,000. Moreover, because a coupon barrier event occurred with
    respect to the second, third and fourth determination periods, no contingent quarterly payment is made with respect to those determination
    periods.</P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">&nbsp;</P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0"><I>In this example, the optional early redemption feature limits
    the term of your investment to approximately 18 months, and you may not be able to reinvest at comparable terms or returns. If
    the securities are redeemed early, you will stop receiving contingent quarterly payments.</I></P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">&nbsp;</P>
    
    
