    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">&nbsp;</P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">Examples 3 and 4 illustrate the payment at maturity per security
    based on the final underlier value of the worst performing underlier.</P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">&nbsp;</P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">In Example 3, the securities are not redeemed prior to maturity
    and a coupon barrier event has occurred during each determination period throughout the term of the securities. As a result, you
    do not receive any contingent quarterly payments during the term of the securities even if the closing levels of the other underliers
    on each scheduled trading day during the determination periods have appreciated or have not declined below their respective downside
    threshold levels and even if the closing level of the worst performing underlier on the determination period-end date for that
    determination period is greater than its downside threshold level. As the final underlier value of the worst performing underlier
    is less than its downside threshold level, you are fully exposed to the decline in the closing level of the worst performing underlier.
    Thus, investors will receive a cash payment at maturity that is significantly less than the stated principal amount per security,
    calculated as follows:</P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">&nbsp;</P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0; text-align: center"><FONT STYLE="background-color: white">(</FONT>$1,000
    <FONT STYLE="background-color: white">&times; underlier performance factor of the </FONT>worst <FONT STYLE="background-color: white">performing
    underlier)</FONT></P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0; text-align: center">&nbsp;</P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0; text-align: center"><FONT STYLE="background-color: white">= </FONT>$1,000
    <FONT STYLE="background-color: white">&times; (final underlier value of the </FONT>worst <FONT STYLE="background-color: white">performing
    underlier / initial underlier value of the </FONT>worst <FONT STYLE="background-color: white">performing underlier)</FONT></P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0; text-align: center">&nbsp;</P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0; text-align: center"><FONT STYLE="background-color: white">= </FONT>$1,000
    <FONT STYLE="background-color: white">&times; (50.00 / 100.00) = $500.00</FONT></P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0; text-align: center">&nbsp;</P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0"><I>In this example, the cash payment you receive at maturity
    is significantly less than the stated principal amount.</I></P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">&nbsp;</P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">In Example 4, the securities are not redeemed prior to maturity
    and a coupon barrier event has occurred during each determination period throughout the term of the securities. As a result, you
    do not receive any contingent quarterly payments with respect to any determination period even if the closing levels of the other
    underliers on each scheduled trading day during the determination periods have appreciated or have not declined below their respective
    downside threshold levels and even if the closing level of the worst performing underlier on the determination period-end date
    for that determination period is greater than its downside threshold level. In addition, the closing level of the worst performing
    underlier decreases to a final underlier value of 80.00. Although the final underlier value of the worst performing underlier is
    less than its initial underlier value, because the final underlier value of the worst performing underlier is still not less than
    its downside threshold level, you receive the stated principal amount at maturity. However, because a coupon barrier event has
    occurred during the final determination period, you will not receive a contingent quarterly payment with respect to the final determination
    period.</P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">&nbsp;</P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0"><I>In this example, although the final underlier value of the
    worst performing underlier represents a 20% decline from its initial underlier value, you receive the stated principal amount of
    $1,000 per security at maturity because the final underlier value of the worst performing underlier is not less than its downside
    threshold level.</I></P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">&nbsp;</P>
    
    
