    of Equity Securities or Exchange-Traded Funds that Hold Equity Securities&rdquo;; and</I></TD></TR></TABLE>
    
    <P STYLE="margin-top: 0pt; margin-bottom: 0pt; font: 10pt Arial, Helvetica, Sans-Serif">&nbsp;</P>
    
    <TABLE CELLPADDING="0" CELLSPACING="0" WIDTH="100%" STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin-top: 0pt; margin-bottom: 0pt"><TR STYLE="vertical-align: top">
    <TD STYLE="width: 36pt"></TD><TD STYLE="width: 27pt">o</TD><TD><I>&ldquo;Risk Factors&mdash;Additional Risks Relating to Securities That We May Call or Redeem (Automatically or Otherwise).&rdquo;</I></TD></TR></TABLE>
    
    <P STYLE="margin-top: 0pt; margin-bottom: 0pt; font: 10pt Arial, Helvetica, Sans-Serif">&nbsp;</P>
    
    <TABLE CELLPADDING="0" CELLSPACING="0" WIDTH="100%" STYLE="font: 12pt Arial, Helvetica, Sans-Serif; margin-top: 0pt; margin-bottom: 0pt"><TR STYLE="vertical-align: top">
    <TD STYLE="width: 0.25in"></TD><TD STYLE="width: 0.25in"><FONT STYLE="font-family: Wingdings; color: #A9C4EB">&sect;</FONT></TD><TD><FONT STYLE="font-family: Arial, Helvetica, Sans-Serif; font-size: 10pt"><B>The securities do not guarantee the return of any
    principal. </B>The terms of the securities differ from those of ordinary debt securities in that the securities do not guarantee
    the return of any of the stated principal amount at maturity. Instead, if the securities have not been redeemed prior to maturity
    and if the final underlier value of any underlier is less than its downside threshold level, you will be exposed to the decline
    in the closing level of the worst performing underlier, as compared to its initial underlier value, on a 1-to-1 basis and you will
    receive for each security that you hold at maturity an amount in cash equal to the stated principal amount <I>times</I> the underlier
    performance factor of the worst performing underlier. Under these circumstances, your payment at maturity will be less than 70%
    of the stated principal amount and could be zero.</FONT></TD></TR></TABLE>
    
    <P STYLE="margin-top: 0pt; margin-bottom: 0pt; font: 12pt Arial, Helvetica, Sans-Serif">&nbsp;</P>
    
    <TABLE CELLPADDING="0" CELLSPACING="0" WIDTH="100%" STYLE="font: 12pt Arial, Helvetica, Sans-Serif; margin-top: 0pt; margin-bottom: 0pt"><TR STYLE="vertical-align: top">
    <TD STYLE="width: 0.25in"></TD><TD STYLE="width: 0.25in"><FONT STYLE="font-family: Wingdings; color: #A9C4EB">&sect;</FONT></TD><TD><FONT STYLE="font-family: Arial, Helvetica, Sans-Serif; font-size: 10pt"><B>You will not receive any contingent quarterly payment
    for any quarterly determination period if a coupon barrier event occurs on any scheduled trading day during that determination
    period with respect to any underlier.</B> The terms of the securities differ from those of ordinary debt securities in that they
    do not provide for regular interest payments. Instead, a contingent quarterly payment will be made with respect to a determination
    period only if a coupon barrier event has not occurred during that determination period. A coupon barrier event will occur if the
    closing level of <B>any</B> underlier is less than its downside threshold level on <B>any</B> scheduled trading day during that
    determination period. If the closing level of at least one underlier is below its downside threshold level on any scheduled trading
    day during a determination period (i.e., if a coupon barrier event has occurred during that determination period), you will not
    receive a contingent quarterly payment with respect to that determination period even if the closing levels of the other underliers
    on each scheduled trading day during the determination periods have appreciated or have not declined below their respective downside
    threshold levels and even if each underlier closes above its downside threshold level on the determination period end date for
    that determination period. Therefore, unless each underlier closes above its downside threshold level on each scheduled trading
    day during a determination period, you will not receive any contingent quarterly payment for that determination period. The closing
    level of the worst performing underlier could be below its downside threshold level on any scheduled trading day during most or
    all of the determination periods so that you receive few or no contingent quarterly payments over the term of the securities. If
    you do not receive sufficient contingent quarterly payments over the term of the securities, the overall return on the securities
    may be less than the amount that would be paid on a conventional debt security of the issuer of comparable maturity.</FONT></TD></TR></TABLE>
    
    <P STYLE="margin-top: 0pt; margin-bottom: 0pt; font: 12pt Arial, Helvetica, Sans-Serif">&nbsp;</P>
    
    <TABLE CELLPADDING="0" CELLSPACING="0" WIDTH="100%" STYLE="font: 12pt Arial, Helvetica, Sans-Serif; margin-top: 0pt; margin-bottom: 0pt"><TR STYLE="vertical-align: top">
    <TD STYLE="width: 0.25in"></TD><TD STYLE="width: 0.25in"><FONT STYLE="font-family: Wingdings; color: #A9C4EB">&sect;</FONT></TD><TD><FONT STYLE="font-family: Arial, Helvetica, Sans-Serif; font-size: 10pt"><B>Early redemption risk. </B>The term of your investment
    in the securities may be limited to as short as approximately three months by the optional early redemption feature of the securities.
    Any early redemption of the securities will be at our discretion and will not automatically occur based on the performance of the
    underliers. It is more likely that we will redeem the securities when it would otherwise be advantageous for you to continue to
    hold the securities. As such, we will be more likely to redeem the securities when the closing level of each underlier is at or
    above its downside threshold level, which would otherwise potentially result in an amount of interest payable on the securities
    that is greater than instruments of a comparable maturity and credit rating trading in the market. In other words, we will be more
    likely to redeem the securities when the securities are paying an above-market coupon. If the securities are redeemed prior to
    maturity, no further contingent quarterly payments will be made on the securities and you may be forced to reinvest in a lower
    interest rate environment. There is no guarantee that you would be able to reinvest the proceeds from an investment in the securities
    in a comparable investment with a similar level of risk in the event the securities are redeemed prior to the maturity date. On
    the other hand, we will be less likely to exercise our redemption right when the closing level of any underlier is below its downside
    threshold level, such that you will receive no contingent quarterly payments and that you might suffer a significant loss on your
    investment in the securities at maturity. Therefore, if we do not exercise our redemption right, it is more likely that you will
    receive few or no contingent quarterly payments and that you will suffer a significant loss on your investment at maturity.</FONT></TD></TR></TABLE>
    
    <P STYLE="margin-top: 0pt; margin-bottom: 0pt; font: 12pt Arial, Helvetica, Sans-Serif">&nbsp;</P>
    
    <TABLE CELLPADDING="0" CELLSPACING="0" WIDTH="100%" STYLE="font: 12pt Arial, Helvetica, Sans-Serif; margin-top: 0pt; margin-bottom: 0pt"><TR STYLE="vertical-align: top">
    <TD STYLE="width: 0.25in"></TD><TD STYLE="width: 0.25in"><FONT STYLE="font-family: Wingdings; color: #A9C4EB">&sect;</FONT></TD><TD><FONT STYLE="font-family: Arial, Helvetica, Sans-Serif; font-size: 10pt"><B>Credit of issuer. </B>The securities are unsecured
    and unsubordinated debt obligations of the issuer, Barclays Bank PLC, and are not, either directly or indirectly, an obligation
    of any third party. Any payment to be made on the securities, including any repayment of principal, is subject to the ability of
    Barclays Bank PLC to satisfy its obligations as they come due and is not guaranteed by any third party. As a result, the actual
    and perceived creditworthiness of Barclays Bank PLC may affect the market value of the securities and, in the event Barclays Bank
    PLC were to default on its obligations, you might not receive any amount owed to you under the terms of the securities.</FONT></TD></TR></TABLE>
    
    <P STYLE="margin-top: 0pt; margin-bottom: 0pt; font: 12pt Arial, Helvetica, Sans-Serif">&nbsp;</P>
    
    
