    <P STYLE="margin-top: 0; margin-bottom: 0">&nbsp;</P>
    
    <TABLE CELLPADDING="0" CELLSPACING="0" WIDTH="100%" STYLE="font: 12pt Arial, Helvetica, Sans-Serif; margin-top: 0pt; margin-bottom: 0pt"><TR STYLE="vertical-align: top">
    <TD STYLE="width: 0.25in"></TD><TD STYLE="width: 0.25in"><FONT STYLE="font-family: Wingdings; color: #A9C4EB">&sect;</FONT></TD><TD><FONT STYLE="font-family: Arial, Helvetica, Sans-Serif; font-size: 10pt; background-color: white"><B>You may lose some or all
    of your investment if any U.K. Bail-in Power is exercised by the relevant U.K. resolution authority.</B> Notwithstanding any other
