    provide direct exposure to fluctuations in exchange rates between the U.S. dollar and the euro with respect to the SX5E Index.
    </FONT></FONT></B><FONT STYLE="font-size: 10pt">The SX5E Index is composed of non-U.S. securities denominated in euro. Because
