    based in part on the performance of the SX5E Index will not be adjusted for exchange rate fluctuations between the U.S. dollar
    and the euro. Therefore, holders of the securities will not benefit from any appreciation of the euro relative to the U.S. dollar.</FONT></TD></TR></TABLE>
    
