    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0 0pt 0.5in">The values of the underliers may be, and have recently
    been, volatile, and we can give you no assurance that the volatility will lessen. See &ldquo;Russell 2000<SUP>&reg;</SUP> Index
    Overview,&rdquo; &ldquo;S&amp;P 500<SUP>&reg;</SUP> Index Overview&rdquo; and &ldquo;EURO STOXX 50<SUP>&reg;</SUP> Index Overview&rdquo;
