    <TD STYLE="width: 0.25in"></TD><TD STYLE="width: 0.25in"><FONT STYLE="font-family: Wingdings; font-size: 12pt; color: #A9C4EB">&sect;</FONT></TD><TD><FONT STYLE="font-family: Arial, Helvetica, Sans-Serif; font-size: 10pt"><B>The estimated value of your securities might be
