    eligible for inclusion in the SPX Index and, effective March 10, 2017, the minimum unadjusted company market capitalization for
    potential additions to the SPX Index was increased to $6.1 billion from $5.3 billion. As of July 31, 2017, the securities of companies
    with multiple share class structures are no longer eligible to be added to the SPX Index, but securities already included in the
    SPX Index have been grandfathered and are not affected by this change. For more information about the SPX Index, see &ldquo;Indices&mdash;The
    S&amp;P U.S. Indices&rdquo; in the accompanying index supplement.</FONT></P>
    
