    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">&nbsp;</P>
    
    <P STYLE="font: 14pt Arial, Helvetica, Sans-Serif; margin: 0pt 0; color: #296DC1">Additional Information about the Securities</P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">&nbsp;</P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">Please read this information in conjunction with the terms on
    the cover page of this document.</P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">&nbsp;</P>
    
    <TABLE CELLSPACING="0" CELLPADDING="0" STYLE="font: 10pt Arial, Helvetica, Sans-Serif; width: 100%; border-collapse: collapse">
    <TR STYLE="vertical-align: top; background-color: #296DC1">
        <TD STYLE="width: 23%"><FONT STYLE="font-family: Arial, Helvetica, Sans-Serif; font-size: 10pt; color: white"><B>Additional provisions:</B></FONT></TD>
        <TD STYLE="width: 2%">&nbsp;</TD>
        <TD STYLE="width: 75%">&nbsp;</TD></TR>
    <TR STYLE="vertical-align: top; background-color: #DCEBF4">
        <TD><FONT STYLE="font-family: Arial, Helvetica, Sans-Serif; font-size: 10pt; color: #296DC1"><B>Record date:</B></FONT></TD>
        <TD>&nbsp;</TD>
        <TD><FONT STYLE="font-family: Arial, Helvetica, Sans-Serif; font-size: 10pt">One business day prior to the related contingent payment date</FONT></TD></TR>
    <TR STYLE="vertical-align: top">
        <TD><FONT STYLE="font-family: Arial, Helvetica, Sans-Serif; font-size: 10pt; color: #296DC1"><B>Minimum ticketing size:</B></FONT></TD>
        <TD>&nbsp;</TD>
        <TD><FONT STYLE="font-family: Arial, Helvetica, Sans-Serif; font-size: 10pt">$1,000 / 1 security</FONT></TD></TR>
    <TR STYLE="vertical-align: top; background-color: #DCEBF4">
        <TD><FONT STYLE="font-family: Arial, Helvetica, Sans-Serif; font-size: 10pt; color: #296DC1"><B>Tax considerations:</B></FONT></TD>
        <TD>&nbsp;</TD>
        <TD>
            <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">You should review carefully the sections entitled &ldquo;Material
            U.S. Federal Income Tax Consequences&mdash;Tax Consequences to U.S. Holders&mdash;Notes Treated as Prepaid Forward or Derivative
            Contracts with Associated (Contingent) Coupons&rdquo; and, if you are a non-U.S. holder, &ldquo;&mdash;Tax Consequences to Non-U.S.
            Holders,&rdquo; in the accompanying prospectus supplement. The following discussion supersedes the discussion in the accompanying
            prospectus supplement to the extent it is inconsistent therewith.</P>
            <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">&nbsp;</P>
            <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">In determining our reporting responsibilities, if any, we intend
            to treat (i) the securities for U.S. federal income tax purposes as prepaid forward contracts with associated contingent coupons
            and (ii) any contingent quarterly payments as ordinary income, as described in the section entitled &ldquo;Material U.S. Federal
            Income Tax Consequences&mdash;Tax Consequences to U.S. Holders&mdash;Notes Treated as Prepaid Forward or Derivative Contracts with
            Associated (Contingent) Coupons&rdquo; in the accompanying prospectus supplement. Our special tax counsel, Davis Polk &amp; Wardwell
            LLP, has advised that it believes this treatment to be reasonable, but that there are other reasonable treatments that the Internal
            Revenue Service (the &ldquo;IRS&rdquo;) or a court may adopt.</P>
            <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">&nbsp;</P>
            <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0"><I>Sale, exchange or redemption of a security.</I> Assuming the
            treatment described above is respected, upon a sale or exchange of the securities (including upon early redemption or redemption
            at maturity), you should recognize capital gain or loss equal to the difference between the amount realized on the sale or exchange
            and your tax basis in the securities, which should equal the amount you paid to acquire the securities (assuming contingent quarterly
            payments are properly treated as ordinary income, consistent with the position referred to above). This gain or loss should be
            short-term capital gain or loss unless you hold the securities for more than one year, in which case the gain or loss should be
            long-term capital gain or loss, whether or not you are an initial purchaser of the securities at the issue price. The deductibility
            of capital losses is subject to limitations. If you sell your securities between the time your right to a contingent quarterly
            payment is fixed and the time it is paid, it is likely that you will be treated as receiving ordinary income equal to the contingent
            quarterly payment. Although uncertain, it is possible that proceeds received from the sale or exchange of your securities prior
            to a determination period-end date but that can be attributed to an expected contingent quarterly payment could be treated as ordinary
            income. You should consult your tax advisor regarding this issue.</P>
            <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">&nbsp;</P>
            <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">As noted above, there are other reasonable treatments that the
            IRS or a court may adopt, in which case the timing and character of any income or loss on the securities could be materially affected.
            In addition, in 2007 the U.S. Treasury Department and the IRS released a notice requesting comments on the U.S. federal income
            tax treatment of &ldquo;prepaid forward contracts&rdquo; and similar instruments. The notice focuses in particular on whether to
            require investors in these instruments to accrue income over the term of their investment. It also asks for comments on a number
            of related topics, including the character of income or loss with respect to these instruments and the relevance of factors such
            as the nature of the underlying property to which the instruments are linked. While the notice requests comments on appropriate
            transition rules and effective dates, any Treasury regulations or other guidance promulgated after consideration of these issues
            could materially affect the tax consequences of an investment in the securities, possibly with retroactive effect. You should consult
            your tax advisor regarding the U.S. federal income tax consequences of an investment in the securities, including possible alternative
            treatments and the issues presented by this notice.</P>
            <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">&nbsp;</P>
            <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0"><I>Non-U.S. holders.</I> Insofar as we have responsibility as
            a withholding agent, we do not currently intend to treat contingent quarterly payments to non-U.S. holders (as defined in the accompanying
            prospectus supplement) as subject to U.S. withholding tax. However, non-U.S. holders should in any event expect to be required
            to provide appropriate Forms W-8 or other documentation in order to establish an exemption from backup withholding, as described
            under the heading &ldquo;&mdash;Information Reporting and Backup Withholding&rdquo; in the accompanying prospectus supplement.
            If any withholding is required, we will not be required to pay any additional amounts with respect to amounts withheld.</P>
            <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">&nbsp;</P>
            <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">Treasury regulations under Section 871(m) imposing a
    withholding tax on certain &ldquo;dividend equivalents&rdquo; under certain &ldquo;equity linked instruments&rdquo; exclude from
    their scope instruments issued in 2017 that do not have a &ldquo;delta of one&rdquo; with respect to underlying securities that
    could pay U.S.-source dividends for U.S. federal income tax purposes (each an &ldquo;Underlying Security&rdquo;). Based on our
    determination that the securities do not have a &ldquo;delta of one&rdquo; within the meaning of the regulations, we expect that
    these regulations will not apply to the securities with regard to non-U.S. holders. Our determination is not binding on the IRS,
    and the IRS may disagree with this determination. Section</P></TD></TR>
    </TABLE>
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0"><I>&nbsp;</I></P>
    
