        <TD STYLE="width: 75%; font-size: 10pt; layout-grid-mode: char">871(m) is complex and its application may depend on your particular circumstances, including whether you enter into other transactions with respect to an Underlying Security. If necessary, further information regarding the potential application of Section 871(m) will be provided in the pricing supplement for the securities. You should consult your tax advisor regarding the potential application of Section 871(m) to the securities.</TD></TR>
    <TR STYLE="vertical-align: top">
