    <TR STYLE="vertical-align: top; background-color: #DCEBF4">
        <TD><FONT STYLE="font-family: Arial, Helvetica, Sans-Serif; font-size: 10pt; color: #296DC1"><B>Calculation agent:</B></FONT></TD>
        <TD>&nbsp;</TD>
        <TD><FONT STYLE="font-family: Arial, Helvetica, Sans-Serif; font-size: 10pt">Barclays Bank PLC</FONT></TD></TR>
    <TR STYLE="vertical-align: top">
        <TD><FONT STYLE="font-family: Arial, Helvetica, Sans-Serif; font-size: 10pt; color: #296DC1"><B>Use of proceeds and hedging:</B></FONT></TD>
        <TD>&nbsp;</TD>
        <TD>
            <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0; text-indent: 0.6pt">The net proceeds we receive from the sale
            of the securities&nbsp;will be used for various corporate purposes as set forth in the prospectus and prospectus supplement and,
            in part, in connection with hedging our obligations under the securities&nbsp;through one or more of our subsidiaries.</P>
            <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0; text-indent: 0.6pt">&nbsp;</P>
            <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0; text-indent: 0.6pt">We, through our subsidiaries or
    others, hedge our anticipated exposure in connection with the securities by taking positions in futures and options contracts
    on the underliers and any other securities or instruments&nbsp;we may wish to use in connection with such hedging. Trading and
    other transactions by us or our affiliates could affect the values of the underliers, the market value of the securities or any
    amounts payable on the securities.&nbsp;For further information on our use of proceeds and hedging, see &ldquo;Use of Proceeds
    and Hedging&rdquo;&nbsp;in the prospectus supplement.</P></TD></TR>
    <TR STYLE="vertical-align: top; background-color: #DCEBF4">
        <TD><FONT STYLE="font-family: Arial, Helvetica, Sans-Serif; font-size: 10pt; color: #296DC1"><B>ERISA:</B></FONT></TD>
        <TD>&nbsp;</TD>
        <TD><FONT STYLE="font-family: Arial, Helvetica, Sans-Serif; font-size: 10pt">See &ldquo;Benefit Plan Investor Considerations&rdquo; in the accompanying prospectus supplement.</FONT></TD></TR>
    <TR STYLE="vertical-align: top">
        <TD><FONT STYLE="font-family: Arial, Helvetica, Sans-Serif; font-size: 10pt; color: #296DC1"><B>Contact:</B></FONT></TD>
        <TD>&nbsp;</TD>
        <TD><FONT STYLE="font-family: Arial, Helvetica, Sans-Serif; font-size: 10pt">Morgan Stanley Wealth Management clients may contact their local Morgan Stanley branch office or Morgan Stanley&rsquo;s principal executive offices at 1585 Broadway, New York, New York 10036 (telephone number (866) 477-4776). All other clients may contact their local brokerage representative. Third-party distributors may contact Morgan Stanley Structured Investment Sales at (800) 233-1087.</FONT></TD></TR>
    </TABLE>
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0"><I>&nbsp;</I></P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0"><I>This document represents a summary of the terms and conditions
    of the securities. We encourage you to read the accompanying prospectus, prospectus supplement and index supplement for this offering,
    which can be accessed via the hyperlinks on the cover page of this document.</I></P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">&nbsp;</P>
    
    <P STYLE="font: 14pt Arial, Helvetica, Sans-Serif; margin: 0pt 0; color: #296DC1">Supplemental Plan of Distribution</P>
    
    <P STYLE="font: 14pt Arial, Helvetica, Sans-Serif; margin: 0pt 0; color: #296DC1">&nbsp;</P>
    
    <P STYLE="font: 10pt Arial, Helvetica, Sans-Serif; margin: 0pt 0">Morgan Stanley Smith Barney LLC (&ldquo;Morgan Stanley Wealth
    Management&rdquo;) and its financial advisors will collectively receive from the agent, Barclays Capital Inc., a fixed sales commission
    of $15.00 for each security they sell. In addition, Morgan Stanley Wealth Management will receive a structuring fee of $5.00 for
    each security.</P>
    
